import './cont.css';
import Homepage from './components/PageOne';
import Header from './components/Header';

class Home extends Component{
    render(){
        return(
           <div className="cont"> 
             <Homepage/>
            </div>
        )
    }
}

class About extends Component{

    render(){        
    let a:string='About',i:string='message';

        return(

<div className = "cont">

<Header a = {a} i={i}/>

</div>

        )
    }
}


export {Home,About}
